import React from "react";
import "./App.css";

class App extends React.Component {
  constructor(props) {
    this.state = {
      title: "Mande",
      headerLinks: [
        { title: "Home", patj: "/" },
        { title: "About", patj: "/about" },
        { title: "Contact", patj: "/contact" },
      ],
      home: {
        title: "Titulo Home",
        subTitle: "subTitulo Home",
        text: "texto Home",
      },
      about: {
        title: "Titulo About",
      },
      contact: {
        title: "Titulo Contact",
      },
    };
  }

  render() {
    return <p>hola Perra</p>;
  }
}

export default App;
